import { Component, OnInit } from '@angular/core';
import { AnalyticsService } from 'src/app/services/analytics/analytics.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent implements OnInit {

  constructor(
    private analyticsService: AnalyticsService
  ) { }

  ngOnInit(): void {
    // Adjust analytics tracking to reflect the Munch Mates app
    this.analyticsService.sendAnalyticPageView("/munch-mates", "User visited Munch Mates Landing Page");
  }
}
<main>
  <!-- Hero banner or introduction -->
  <app-banner></app-banner>

  <!-- About section for Munch Mates explanation -->
  <app-about></app-about>

  <!-- Project section could be for showcasing features or testimonials -->
  <app-proyects></app-proyects>

  <!-- Contact section to include call-to-action like "Get Started" or "Contact Us" -->
  <app-contact></app-contact>
</main>
